// AddMealRecipes adds the given related objects to the existing relationships
// of the meal, optionally inserting them as new records.
// Appends related to o.R.MealRecipes.
// Sets related.R.Meal appropriately.
func (o *Meal) AddMealRecipes(ctx context.Context, exec boil.ContextExecutor, insert bool, related ...*MealRecipe) error {
	var err error
	for _, rel := range related {
		if insert {
			rel.MealID = o.ID
			if err = rel.Insert(ctx, exec, boil.Infer()); err != nil {
				return errors.Wrap(err, "failed to insert into foreign table")
			}
		} else {
			updateQuery := fmt.Sprintf(
				"UPDATE \"meal_recipe\" SET %s WHERE %s",
				strmangle.SetParamNames("\"", "\"", 1, []string{"meal_id"}),
				strmangle.WhereClause("\"", "\"", 2, mealRecipePrimaryKeyColumns),
			)
			values := []interface{}{o.ID, rel.MealID, rel.RecipeID}

			if boil.IsDebug(ctx) {
				writer := boil.DebugWriterFrom(ctx)
				fmt.Fprintln(writer, updateQuery)
				fmt.Fprintln(writer, values)
			}
			if _, err = exec.ExecContext(ctx, updateQuery, values...); err != nil {
				return errors.Wrap(err, "failed to update foreign table")
			}

			rel.MealID = o.ID
		}
	}

	if o.R == nil {
		o.R = &mealR{
			MealRecipes: related,
		}
	} else {
		o.R.MealRecipes = append(o.R.MealRecipes, related...)
	}

	for _, rel := range related {
		if rel.R == nil {
			rel.R = &mealRecipeR{
				Meal: o,
			}
		} else {
			rel.R.Meal = o
		}
	}
	return nil
}

